import React from 'react';


class AddNewFish extends React.Component {
  name = React.createRef();
  addFish = event =>{
    event.preventDefault();

  }
  render() {
    return(
      <form className="fish-edit" onSubmit={this.addFish}>
        <input ref ={this.name} name="name" type= "text" placeholder="Name" />
        <input  ref ={this.price} name="price" type= "text" placeholder="Price"/>
        <select>
          <option value = "true"> Fresh!</option>
          <option value = "true"> sold out!</option>
        </select>
        <textarea ref ={this.desc} name="desc" placeholder="desc"></textarea>
        <input ref ={this.image} name="image" type= "text" placeholder = "Image"/>
        <button type="submit">+ Add</button>
      </form>
    )
  }
}

export default AddNewFish;
